import User from "../models/User";
import bcrypt from "bcrypt";
import fetch from "node-fetch";

export const getJoin = (req, res) =>{
    res.render("join", {pageTitle: "Join"});
};

export const postJoin = async (req, res) =>{
    const {name, username, email, password,password2, location} = req.body;
    const pageTitle = "Join";
    if(password !== password2){
        return res.status(400).render("join",{
            pageTitle,
            errorMessage : "password confirmaion does not match.",
        });
    }
    const exists = await User.exists({$or: [{username}, {email}]});
     //$or Î•º ÌÜµÌï¥ÏÑú Ïó¨Îü¨ ÏºÄÏù¥Ïä§Î•º ÌïúÏ§ÑÎ°ú Ìï¥Í≤∞ Í∞ÄÎä•.
    if(exists){
        return res.status(400).render("join",{
            //status(400) ÏùÑ ÎÑ£Ïñ¥Ï§åÏúºÎ°ú ÏóêÎü¨Î•º Ï≤òÎ¶¨ÌïúÎã§.
            pageTitle,
            errorMessage : "This username/email is already taken",
        });
    };
    try{
        await User.create({
            name,
            username,
            email,
            password,
            location,
         });
         return res.redirect("/login");
    }catch(error){
        return res.status(400).render("join",{
            pageTitle: "Join Video",
            errorMessage : error._message,
        });
    }
};



export const getLogin = (req, res) =>{
    res.render("login", {pageTitle: "Login"});
};

export const postLogin = async (req, res) =>{
    //check if account exists
    // check if password correct
    const {pageTitle} = "Login";
    const {username, password} = req.body;
    // Î∏åÎùºÏö∞Ï†ÄÎ•º ÌÜµÌï¥ÏÑú ÏûÖÎ†• Î∞õÏùÄ ÎÇ¥Ïö©
    const user = await User.findOne({username, socialOnly:false});
    // ÎîîÎπÑÏóêÏÑú Í∫ºÎÇ¥Ïò® ÎÇ¥Ïö©
    if(!user){
        return res.status(400)
            .render("login",{
            pageTitle, 
            errorMessage:"An account with this username does not exists."});
    };

    const ok = await bcrypt.compare(password, user.password);
    if(!ok){
        return res.status(400)
            .render("login",{
            pageTitle, 
            errorMessage:"Wrong password."});
    };
    req.session.loggedIn = true;
    //loggedInÏùÄ ÎÇ¥Î∂ÄÏ†ÅÏúºÎ°ú Ï†ÄÏû•ÎêòÏñ¥ ÏûàÎäîÍ≤å ÏïÑÎãàÎùº Í∑∏ÎÉ• Ï∂îÍ∞ÄÌïúÍ±∞Îã§. userÎèÑ ÎßàÏ∞¨Í∞ÄÏßÄ.
    //ÌïÑÏöîÌïú ÎÇ¥Ïö©ÏùÑ ÏÑ∏ÏÖòÏóê Ïù¥Îü∞ÏãùÏúºÎ°ú Ï∂îÍ∞ÄÌï† Ïàò ÏûàÎã§.
    req.session.user= user;
    //ÎîîÎπÑÏóêÏÑú Í∫ºÎÇ¥Ïò® ÎÇ¥Ïö©ÏùÑ ÏÑ∏ÏÖòÏóê Îã¥ÎäîÎã§Í≥† ÏÉùÍ∞ÅÌïòÏûê.
    // ÏúÑ ÎÇ¥Ïö©ÏùÄ middlewareÏóêÏÑú ÏÑ∏ÏÖòÎ≥ÑÎ°ú Î°úÍ∑∏Ïù∏ Ïù∏Ï¶ùÏùÑ Ï≤òÎ¶¨ÌïúÎã§.
    return res.redirect("/");
}

export const startGithubLogin = (req,res)=>{
    const baseUrl = 'https://github.com/login/oauth/authorize?';
    const config = {
        client_id:process.env.GH_CLIENT,
        allow_signup:false,
        scope:"read:user user:email",
    }; // ÏúÑ ÎÇ¥Ïö©ÏùÄ ÍπÉÌóôÏóêÏÑú ÏöîÍµ¨ÌïòÎäî ÌååÎùºÎØ∏ÌÑ∞Ïùò Ïù¥Î¶ÑÏù¥Îã§. 
    // Í∞Å ÌöåÏÇ¨Î≥ÑÎ°ú ÏöîÍµ¨ÌïòÎäî Ïù¥Î¶ÑÏù¥ Îã§Î•¥Îãà Í∑∏ Ï†êÏóê Ïú†ÏùòÌïòÎ©¥ÏÑú ÏûëÏÑ±ÌïòÎèÑÎ°ù ÌïúÎã§.
    const params = new URLSearchParams(config).toString();
    const finalUrl = `${baseUrl}${params}`;
    return res.redirect(finalUrl);
};

export const finishGithubLogin = async (req, res) =>{
    const baseUrl = "https://github.com/login/oauth/access_token?";
    const config = {
        client_id:process.env.GH_CLIENT,
        client_secret:process.env.GH_SECRET,
        code:req.query.code,
    };
    const params = new URLSearchParams(config).toString();
    const finalUrl = `${baseUrl}${params}`;
    const tokenRequest = await (
        await fetch(finalUrl,{
        method:"POST",
        headers : {
            Accept: "application/json",
        },
    })
    ).json(); // fetch? -> ÏÑúÎ≤ÑÏóî ÏóÜÍ≥† Î∏åÎùºÏö∞Ï†ÄÏóêÎßå Ï°¥Ïû¨ÌïúÎã§.
    // Í∑∏Îü¨ÎØÄÎ°ú ÎÖ∏ÎìúÏóêÏÑú Îã§Ïö¥Î∞õÎäîÎã§.
    if("access_token" in tokenRequest){
        const {access_token} = tokenRequest;
        //github APIÏôÄ ÏÜåÌÜµÌïòÍ∏∞ ÏúÑÌïú ÏóëÏÑ∏Ïä§„Ö°ÌÜ†ÌÅ∞Ïù¥Îã§. Í∑úÍ≤©Ïù¥Îã§.
        const apiUrl = "http://api.github.com";
        const userData = await (
            await fetch(`${apiUrl}/user`, {
            headers:{
                Authorization: `token ${access_token}`
            }
        })
        ).json();
        const emailData = await (
            await fetch(`${apiUrl}/user/emails`, {
                headers:{
                    Authorization: `token ${access_token}`
                }
            })
        ).json();
        const emailObj = emailData.find(
            (email) => email.primary === true && email.verified === true);
        if(!emailObj){
            return res.redirect("/login");
        } 
        let user = await User.findOne({email:emailObj.email});
        if(!user){
            user = await User.create({
                avatarUrl:userData.avatar_url,
                name : userData.name,
                username : userData.login,
                email : emailObj.email,
                password:"",
                socialOnly:true,
                location:userData.location,
            });
        }
        //userData Îäî APIÎ°úÎ∂ÄÌÑ∞ Ïò§Î©∞, emailData ÎòêÌïú ÍπÉÌóôAPIÎ°úÎ∂ÄÌÑ∞ Ïò®Îã§ÎäîÍ±∏
        req.session.loggedIn = true;
        req.session.user = user;
        return res.redirect("/");
    }else{
        return res.redirect("/login");
    }

};


export const logout = (req,res) =>{
    req.flash("error", "byebye");
    req.session.destroy();
    return res.redirect("/");
};


export const getEdit = (req,res) =>{
    return res.render("edit-profile",{pageTitle:"Edit Profile",user:req.session.user});
}

export const postEdit = async (req,res) =>{
    // email Ï§ëÎ≥µÏ≤¥ÌÅ¨ ÏΩîÎìú Ï±åÎ¶∞ÏßÄ.
    const {
        session : {
            user:{_id, avatarUrl},
        },
        body:{name,email,username,location},
        file,
    } = req;
    const updateUser = await User.findByIdAndUpdate(
        _id, 
    {
        avatarUrl: file ? file.path : avatarUrl,
        name,
        email,
        username,
        location,
    },
    {new :true});
    // findByIdAndUpdateÎäî ÏóÖÎç∞Ïù¥Ìä∏ ÎêòÍ∏∞ Ï†ÑÏùò Îç∞Ïù¥ÌÑ∞Î•º Î¶¨ÌÑ¥Ìï¥Ï£ºÍ≥†  {new :true} Î•º ÏÑ§Ï†ïÌï¥Ï£ºÎ©¥ findByIdAndUpdateÍ∞Ä
    // ÏóÖÎç∞Ïù¥Ìä∏Îêú Îç∞Ïù¥ÌÑ∞Î•º Î¶¨ÌÑ¥Ìï¥Ï§ÑÍ≤ÉÏù¥Îã§. Ïù¥ÏôÄÍ∞ôÏù¥ÌïòÎ©¥ ÏïÑÎûò Ï£ºÏÑùÎÇ¥Ïö©Ï≤òÎüº Í∏∏Í≤å ÏûëÏÑ±Ìï† ÌïÑÏöîÍ∞Ä ÏóÜÎã§.
    req.session.user = updateUser;
    // req.session.user = {
    //     ...req.session.user,
    //     // ÏÑ∏ÏÖòÏóÖÎç∞Ïù¥Ìä∏ Í≥ºÏ†ïÏóêÏÑú ÏàòÏ†ïÎêòÏßÄ ÏïäÎäî ÎÇ¥Ïö©Ïù¥ ÏûàÍ∏∞ÎïåÎ¨∏Ïóê Î®ºÏ†Ä ÎçÆÏñ¥Ï£ºÍ≥† ÏàòÏ†ïÎêú ÎÇ¥Ïö©ÏùÑ Î∞ëÏóê ÏûëÏÑ±Ìï¥Ï§ÄÎã§.
    //     name,
    //     email,
    //     username,
    //     location,
    // };
    // ÌèºÏóêÏÑú ÎÇ¥Ïö©ÏùÑ Î∞õÍ≥† ÎîîÎπÑÏóê ÏóÖÎç∞Ïù¥Ìä∏Î•º ÌñàÏßÄÎßå ÏÑ∏ÏÖòÎèÑ ÏóÖÎç∞Ïù¥Ìä∏Î•º Ìï¥Ï§òÏïºÌïúÎã§.
    //Í∑∏ÎûòÏïºÎßå ÌîÑÎ°†Ìä∏ÏóêÏÑú Î≥ÄÍ≤ΩÎêú Í∞íÏù¥ Î≥¥Ïù∏Îã§.
    return res.redirect("/users/edit");
}

export const getChangePassword = (req,res) =>{
    if(req.session.user.socialOnly === true){
        return res.redirect("/");
    }
    return res.render("users/change-password", {pageTitle:"change Password"});
}

export const postChangePassword = async (req,res) =>{
    const {
        session : {
            user:{_id,password},
        },
        body:{oldPassword,
            newPassword,
            newPasswordConfirmation,
        },
    } = req;
    const user = await User.findById(_id);
    const ok = await bcrypt.compare(oldPassword, user.password);
    if(!ok){
        return res.status(400)
        .render("users/change-password", {
            pageTitle:"change Password", 
            errorMessage: "the current password is incorrect"
        });
    }
    if(newPassword !== newPasswordConfirmation){
        return res.status(400)
        .render("users/change-password", {
            pageTitle:"change Password", 
            errorMessage: "the password does not match"
        });
    }
    user.password = newPassword;
    user.save();
    //req.session.user.password = user.password;
    // ÏÑ∏ÏÖòÍ≥º ÎîîÎπÑ ÏóÖÎç∞Ïù¥Ìä∏Î•º Í∞ÅÍ∞Å Ìï¥Ï§òÏïºÌïúÎã§.
    return res.redirect("/users/logout");
};

export const see = async (req, res) =>{
    const { id } = req.params;
    const user = await User.findById(id).populate({
        path: "videos",
        populate: {
          path: "owner",
          model: "User",
        },
      });
    if(!user){
        return res.status(404).render("404",{pageTitle:"User not found"});
    }
    return res.render("users/profile", {pageTitle: user.name, user});
};

