import Video from "../models/Video";
import Comment from "../models/Comment";
import User from "../models/User";



// Video.find({}, (error, videos)=>{  
// });

export const home = async(req,res) =>{
    const videos = await Video.find({})
    .sort({ createdAt: "desc" })
    .populate("owner");
    //db ÏóêÏÑú videoÍ∞Ä Ï°¥Ïû¨Ìï† Îïå Í∑∏ ÎÇ¥Ïö©ÏùÑ Ï∞æÏïÑÏÑú videos Ïóê Îã¥ÎäîÎã§.
    console.log(videos);
    res.render("home", {pageTitle: "home", videos});
};

export const watch = async (req, res) => {
    const { id } = req.params;
    // == const id = req.params.id;
    // idÎ•º ÏΩòÏÜîÏ∞ΩÏóê Ï∂úÎ†•Ìï¥Î≥¥Î©¥ ÎπÑÎîîÏò§Ïóê ÎåÄÌïú idÍ∞Ä ÎÇòÏò®Îã§. 
    // idÎäî Ïñ¥ÎîîÏÑú Ïò§ÎäîÍ∞Ä? ÎπÑÎîîÏò§ Î™©Î°ùÏóêÏÑú ÎπÑÎîîÏò§Î•º ÎàÑÎ•¥Î©¥ url ÏïàÏóê IdÍ∞Ä Ï°¥Ïû¨ÌïúÎã§. 
    // idÎ•º Î∞îÌÉïÏúºÎ°ú Í∑∏ ÎπÑÎîîÏò§Î•º Ï∞æÎäî Í≤ÉÏù¥Îã§.
    // ÎîîÎπÑÏóê Ïó∞Í≤∞ Îêú Í≤ΩÏö∞ÏóêÎäî req.params Î°ú Í∞ÄÏ†∏Ïò® idÎßåÏúºÎ°úÎèÑ ÎπÑÎîîÏò§Î•º Ï∞æÏùÑ Ïàò ÏûàÎã§Îäî Í≤ÉÏùÑ ÏïåÎ†§Ï§ÄÎã§.
    const video = await Video.findById(id).populate("owner").populate("comments");
    if (!video){
        return res.status(404).render("404",{pageTitle: "Video not found."});
    }
    return res.render("watch", {pageTitle :"Watching", video/* == video:video*/});
};

export const getEdit = async (req,res) =>{
    const {id} = req.params;
    const {user: {_id}} = req.session;
    const video = await Video.findById(id);
    if (!video){
        return res.status(404).render("404",{pageTitle: "Video not found."});
    }
    if(String(video.owner) !== String(_id)){
        req.flash("error", "Not authorized");
        //Ïñ¥Îñ†Ìïú ÏÉÅÌô©ÏóêÏÑúÎèÑ Î∞±ÏóîÎìúÏóêÏÑú Î≥∏Ïù∏Ïù¥ ÏïÑÎãå Ïù¥ÏÉÅ ÏàòÏ†ïÏù¥ Î∂àÍ∞ÄÎä•ÌïòÍ≤å ÌïúÎã§.
        return res.status(403).redirect("/");
    }
    return res.render("edit", {pageTitle: `Edit ${video.title}`, video});
};

export const postEdit = async (req, res) =>{
    const {id} = req.params;
    const {user: {_id}} = req.session;
    const {title, description, hashtags} = req.body;
    // ÏàòÏ†ïÌïòÍ≥† Ïã∂ÏùÄ ÎÇ¥Ïö©Îì§ÏùÑ Ïó¨Í∏∞Ïóê Îã¥ÏïÑÎëêÍ≥† Î∞ëÏóêÏÑú ÏàòÏ†ïÌïòÎäîÍ±∞Îã§.
    // bodyÎäî formÏùÑ ÌÜµÌï¥ Î∞õÏùÄ ÎÇ¥Ïö©Îì§ÏùÑ Í∞ÄÏ†∏Ïò§Îäî Í≤ÉÏù¥Îã§.
    const video = await Video.exists({_id : id});
    // findByIdÎ•º ÏÇ¨Ïö©ÌïòÎ©¥ ÎπÑÎîîÏò§ Ï†ÑÏ≤¥Î•º Í∞ÄÏ†∏Ïò§ÎäîÎç∞ Íµ≥Ïù¥? Ïù¥Îü∞ ÎäêÎÇåÏù¥Îã§
    // exists Î•º ÏÇ¨Ïö©ÌïòÎ©¥ Ìï¥Îãπ ÏïÑÏù¥ÎîîÏóê ÏÜçÌïú ÎπÑÎîîÏò§Í∞Ä ÏûàÎäîÏßÄ t/fÎ°ú ÏïåÎ†§Ï§ÄÎã§. Ï∂îÍ∞ÄÏ†ÅÏúºÎ°ú ÌååÎùºÎØ∏ÌÑ∞Îäî filterÎ°ú Î∞õÎäîÎã§. 
    // Ïù¥Í±¥ ÎπÑÎîîÏò§Í∞Ä ÏûàÎäîÏßÄ idÎ•º ÌÜµÌï¥ Ï∞æÏïÑÏò®Í±∞ÏßÄ ÏÑ∏Î∂ÄÎÇ¥Ïö©ÏùÑ Í∞ÄÏ†∏Ïò§ÎäîÍ≤å ÏïÑÎãàÎã§.
    if(!video){
        return res.render("404",{pageTitle: "Video not found."});
    }
    if(String(video.owner) !== String(_id)){
        //Ïñ¥Îñ†Ìïú ÏÉÅÌô©ÏóêÏÑúÎèÑ Î∞±ÏóîÎìúÏóêÏÑú Î≥∏Ïù∏Ïù¥ ÏïÑÎãå Ïù¥ÏÉÅ ÏàòÏ†ïÏù¥ Î∂àÍ∞ÄÎä•ÌïòÍ≤å ÌïúÎã§.
        return res.status(403).redirect("/");
    }
    await Video.findByIdAndUpdate(id, {
        // this.title = title Ïù¥Îü∞ÏãùÏúºÎ°ú ÌïòÏßÄ ÏïäÍ≥† mongoose Ïóê ÏûàÎäî Ìï®ÏàòÎ•º ÏÇ¨Ïö©ÌïòÏó¨ÏÑú 
        // Î∞îÍøÄ ÎÇ¥Ïö©ÏùÑ Íµ¨Ï°∞Ï†ÅÏúºÎ°ú Î≥¥Ïó¨Ï£ºÍ≥† ÌïúÎ≤àÏóê Ìï¥Í≤∞ÌïòÎäî Íµ¨Ï°∞Î•º ÎßåÎì§Ïñ¥Ï§ÄÎã§. createÏôÄ Ïú†ÏÇ¨.
        title,
        description,
        hashtags: Video.formatHashtags(hashtags),
    })
    return res.redirect(`/videos/${id}`);
};

export const getUpload = (req,res) =>{
    return res.render("upload",{pageTitle: "Upload Video"});
};

export const postUpload = async(req, res) =>{ 
    const {
        user:{_id},
    } = req.session;
    const {video, thumb} = req.files;
    const {
        title,
        description,
        hashtags,
    } = req.body;
    try{
        const newVideo = await Video.create({
        title,
        // == title : this.title ÏûêÎ∞îÏãùÏúºÎ°ú Ïß¨ÎΩïÌï¥ÏÑú Ïì∞Î©¥ Ïù¥Îü∞ÏãùÏù¥Îã§.
        description,
        //createdAt: Date.now(),
        fileUrl : video[0].path,
        thumbUrl : thumb[0].path,
        owner:_id,
        hashtags: Video.formatHashtags(hashtags),
        // meta:{
        //     views:0,
        //     rating:0,
        // },
        // Î™®Îç∏ÏóêÏÑú ÎîîÌè¥Ìä∏ Í∞íÏùÑ Ï£ºÏóàÍ∏∞ ÎïåÎ¨∏Ïóê Íµ≥Ïù¥ Îã§Ïãú Ïì∏ ÌïÑÏöîÍ∞Ä ÏóÜÏñ¥ÏßÑ ÎÇ¥Ïö©Îì§Ïù¥Îã§. -> Ìó∑Í∞àÎ¶¨Î©¥ 6.17 Í∞ïÏùò ÌôïÏù∏
    }); // Ïù¥Í≤ÉÏùÄ ÎπÑÎîîÏò§ Ïò§Î∏åÏ†ùÌä∏Î•º ÏÉùÏÑ±Ìïú ÎÇ¥Ïö©Ïù¥Îã§ ÏßÑÏßú Îç∞Ïù¥ÌÑ∞ÏôÄ Í¥ÄÎ†®Ïù¥ ÏûàÎäî ÏúÑÏπòÎã§. 
    // ÏÉàÎ°úÏö¥ ÎπÑÎîîÏò§Í∞Ä ÏÉùÏÑ±Îê† ÎïåÎßàÎã§ mongooseÏóêÏÑú Í≥†Ïú†Ïùò idÎ•º Ï§ÄÎã§
    // Ï∂îÍ∞ÄÏ†ÅÏúºÎ°ú Ïó¨Í∏∞ÍπåÏßÄÎßå ÌïúÎã§Î©¥ Îç∞Ïù¥ÌÑ∞Î≤†Ïù¥Ïä§Ïóê Ï†ÄÏû•ÎêòÎäî Í≤ÉÏùÄ ÏïÑÎãàÎã§. Ïñ¥ÎñªÍ≤å Ï†ÄÏû•ÌïòÎäîÍ∞Ä?
    //await video.save();
    //Ïù¥Î†áÍ≤å ÌïúÎã§. save Îäî promiseÎ•º Î¶¨ÌÑ¥Ìï¥Ï£ºÎäîÎç∞ Ï†ÄÏû•Ïù¥ Îê† ÎïåÍπåÏßÄ Í∏∞Îã§Î¶¨Í∏∞ ÏúÑÌï¥ async, awaitÎ•º ÏÇ¨Ïö©ÌïúÎã§.
    // Ï∂îÍ∞ÄÏ†ÅÏúºÎ°ú saveÎäî Î™ΩÍµ¨Ïä§Í∞Ä Ìï¥Ï£ºÎäî Í≤ÉÏù¥Îã§.
    const user = await User.findById(_id);
    user.videos.push(newVideo._id);
    user.save();
    return res.redirect("/");
    } catch(error){
        return res.status(400).render("upload",{
            pageTitle: "Upload Video",
            errorMessage : error._message,
        });
    }
};

export const deleteVideo = async (req,res)=>{
    const {
        user:{_id},
    } = req.session;
    const {id} = req.params;
    const video = await Video.findById(id);
    if(!video){
        return res.render("404",{pageTitle: "Video not found."});
    }
    if(String(video.owner) !== String(_id)){
        //Ïñ¥Îñ†Ìïú ÏÉÅÌô©ÏóêÏÑúÎèÑ Î∞±ÏóîÎìúÏóêÏÑú Î≥∏Ïù∏Ïù¥ ÏïÑÎãå Ïù¥ÏÉÅ ÏàòÏ†ïÏù¥ Î∂àÍ∞ÄÎä•ÌïòÍ≤å ÌïúÎã§.
        return res.status(403).redirect("/");
    }
    await Video.findByIdAndDelete(id);
    return res.redirect("/");
}
// delete, remove Ï∞®Ïù¥?
// -> ÎåÄÎ∂ÄÎ∂ÑÏùò Í≤ΩÏö∞ deleteÎ•º ÏÇ¨Ïö©ÌïúÎã§.

export const search = async (req, res) =>{
    const {keyword} = req.query;
    // ÏûÖÎ†•Î∞õÏùÄ Í∞íÏùÑ Í∞ñÍ≥† Ïò§Îäî query
    let videos = [];
    // if Íµ¨Ï†à Ïú†Ìö®Î≤îÏúÑ Î¨∏Ï†ú ÎïåÎ¨∏Ïóê letÏúºÎ°ú Íµ¨ÏÑ±
    if(keyword){
        // search
        videos = await Video.find({
            title: {
                $regex: new RegExp(`${keyword}$`, "i"),
                // i == ÎåÄÏÜåÎ¨∏Ïûê Íµ¨Î∂ÑÏùÑ ÏïàÌï¥Ï£ºÎäî Ïó≠Ìï†.
                // keywordÎ•º Ìè¨Ìï®ÌïòÎäî ÏòÅÏÉÅÎì§ÏùÑ Ï∞æÏùÑÍ±∞Îã§.
                //‚Ç©^${keyword}‚Ç© => ÌÇ§ÏõåÎìúÎ°ú ÏãúÏûëÌïòÎäî Î¨∏ÏûêÏó¥Îßå Ï∞æÎäîÎã§.
                //Ïù¥Í±¥ Î™ΩÍ≥†ÎîîÎπÑÍ∞Ä Ï†úÍ≥µÌïòÎäî Í∏∞Îä•Ïù¥Îã§.
            }, 
        }).populate("owner");
    }
    return res.render("search", {pageTitle:"Search", videos});
};


export const registerView = async (req, res) =>{
    const {id} = req.params;
    //id from router
    const video = await Video.findById(id);
    if(!video){
        return res.sendStatus(404);
        // statusÎäî Î¨¥Ïñ∏Í∞Ä ÎûúÎçîÎßÅÏùÑ Ìï¥Ï§òÏïºÎßå ÌïòÎäî Î©îÏÜåÎìúÎùº ÏûëÏÑ±ÌïòÎ©¥ ÏóêÎü¨ÎÇúÎã§ Ïñ¥ÎñªÍ≤å Ìï¥Í≤∞ÌïòÎäîÍ∞Ä? sendStatusÎ•º ÏÇ¨Ïö©ÌïúÎã§.
        //statusÎäî Î¨¥Ïñ∏Í∞Ä ÎûúÎçîÎßÅÏùÑ ÌïòÍ∏∞Ï†ÑÏóê ÏÉÅÌÉúÎ•º ÏïåÎ†§Ï£ºÍ∏∞Ïóê ÎûúÎçîÎßÅÏù¥ ÌïÑÏàòÏ†ÅÏù¥Í≥†
        //sendStatusÎäî ÏÉÅÌÉúÎ•º Î≥¥ÎÇ¥Ï£ºÍ≥† Ïó∞Í≤∞ÏùÑ ÎÅäÏñ¥ÎÇ¥Îäî Ïó≠Ìï†Ïù¥Îã§.
    }
    video.meta.views = video.meta.views +1;
    await video.save();
    return res.sendStatus(200);
};

export const createComment = async (req, res) =>{
    const {
        session:{user},
        body:{text},
        params:{id}, 
    } = req;

    const video = await Video.findById(id);
    if(!video){
        return res.sendStatus(404);
    }
    const comment = await Comment.create({
        text,
        owner: user._id,
        video:id,
    });
    video.comments.push(comment._id);
    video.save();
    return res.Status(201).json({newCommentId: comment._id});
}

