import express from "express";
import { watch, getEdit, postEdit, getUpload, postUpload, deleteVideo} from "../controllers/videoController";
import { protectorMiddleware, videoUpload } from "../middlewares";

const videoRouter = express.Router();

videoRouter.get("/:id([0-9a-f]{24})", watch);
// Í∑∏ÎÉ• :id ÌïòÎ©¥ Î™®Îì† Î¨∏Ïûê,Ïà´ÏûêÎ•º Î∞õÏïÑÏÑú ÏõêÌïòÎäî ÌÖúÌîåÎ¶øÏóê Í∞ÄÏßÄ Î™ªÌïòÎäî Î¨∏Ï†úÍ∞Ä Î∞úÏÉùÌïúÎã§.
// Í∑∏Îü∞ Î¨∏Ï†úÎ•º Ìï¥Í≤∞ÌïòÍ∏∞ ÏúÑÌï¥ÏÑú Ïö∞Î¶¨Îäî mongooseÏùò random id Í∞í Î∂ÄÏó¨ÌïòÎäî Í∏∞Ï§ÄÏùÑ Ï∞æÏïÑÎ≥¥Í≥† 16ÏßÑÏàòÎ°ú 24ÏûêÎ¶¨Î•º Î∂ÄÏó¨ÌïúÎã§Îäî Í≤ÉÏùÑ ÏïåÏïÑÎÉàÎã§.
// Í∑∏ Î≤îÏúÑÏóê Îî∞Î•∏ Ï†ïÍ∑úÌëúÌòÑÏãùÏùÑ ÎßåÎì§Ïñ¥ Î≤îÏúÑÎ•º ÏßÄÏ†ïÌï¥Ï£ºÏóàÍ≥† Í∑∏ Î≤îÏúÑ ÏïàÏóê ÎìúÎäî Í≤ΩÏö∞ÏóêÎßå ÌÖúÌîåÎ¶øÏùÑ Í∞ÄÏ†∏Ïò¨ Ïàò ÏûàÎèÑÎ°ù ÌïòÏòÄÎã§.
videoRouter.route("/:id([0-9a-f]{24})/edit").all(protectorMiddleware).get(getEdit).post(postEdit);
videoRouter.route("/:id([0-9a-f]{24})/delete").all(protectorMiddleware).get(deleteVideo);
videoRouter.route("/upload")
    .all(protectorMiddleware)
    .get(getUpload)
    .post(videoUpload.fields([
        {name:"video"},
        {name:"thumb"},
    ]),postUpload);

export default videoRouter;

